import React from 'react';
import './CSS/App.css';
import Login from './Login';
import Reset from './Reset';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';




function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Login/>}/>    
        <Route path='/reset' element={<Reset/>}/> 
      </Routes>
    </Router>
  );
}

export default App;
